import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import "./index.css";
import sdata from "./sdata";


ReactDOM.render(
  <>
  <Card 
  imgsrc={sdata[0].imgSrc}
  title = "A Netflix Origin Series 1"  
  sname="Dark1"  
  link = "https://www.netflix.com/in/title/80990668?source=35"/>

  <Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"
  title = "A Netflix Origin Series 2"  
  sname="Dark2"  
  link = "https://www.netflix.com/in/title/81264882"/>


  <Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"  
  title = "A Netflix Origin Series 3"  
  sname="Dark3"  
  link = "https://www.netflix.com/in/title/81144925"/>

  </>
  ,document.getElementById('root')
);
